  public openTemplateDropdown(event) {
    this.nameToSearch = '';
    this.allTemplates.forEach((temp) => {
      temp.show = true;
    });
    event.stopPropagation();
    this.showTemplateDropdown = !this.showTemplateDropdown;
  }
  public searchTemplate() {
    this.nameToSearch = this.nameToSearch.trim().replace(/\s\s+/g, ' ');
    this.allTemplates.forEach((temp) => {
      if (temp.name.toLowerCase().includes(this.nameToSearch.toLowerCase()) || this.nameToSearch === '') {
        temp.show = true;
      } else {
        temp.show = false;
      }
    });
  }
  public selectTemplate(template) {
    this.template = template.name;
    this.showTemplateDropdown = false;
    if (template.name === 'Medical History' && (this.ehealth.preExistingCondition && this.ehealth.preExistingCondition.length === 0)) {
      this.allowToShare = false;
    } else if (template.name === 'Referral' && (this.case.referralSource === '' && this.case.referrer === '')) {
      this.allowToShare = false;
    } else if (template.name === 'NOK' && ((this.clientDetails.nok && this.clientDetails.nok === '')
      && (this.clientDetails.nokRelationship && this.clientDetails.nokRelationship === '')
      && (this.clientDetails.nokContact && this.clientDetails.nokContact === ''))) {
      this.allowToShare = false;
    } else if (template.name === 'Policy Activated' && this.ehealth.activePolicies.length === 0) {
      this.allowToShare = false;
    } else {
      this.allowToShare = true;
    }
  }
  public selectCheckbox(property) {
    const eventobj = {
      target: {
        checked: this.prevSelectedProperty === property ? false : true,
      },
    };
    this.selectProperty(eventobj, property);
  }
  public selectProperty(event, property) {
    if (event.target.checked) {
      let showAlert = false;
      if (property === 'medical-condition') {
        this.message = 'Medical Condition';
        if (_.size(this.medicalConditions.gastroenterology) === 0 &&
          _.size(this.medicalConditions.orthopaedic) === 0 &&
          _.size(this.medicalConditions.cardiology) === 0 &&
          _.size(this.medicalConditions.gynaecology) === 0 &&
          _.size(this.medicalConditions.urology) === 0 &&
          _.size(this.medicalConditions.ent) === 0 &&
          _.size(this.medicalConditions.respiratory) === 0 &&
          _.size(this.medicalConditions.general) === 0) {
          showAlert = true;
        } else {
          // if (!this.medicalPdf) {
          this.dataService.present().then((loader) => {
            loader.present();
            this.generateMedicalPdf();
          });
          // }
        }
      } else if (property === 'pre-adm-checklist') {
        this.message = 'Pre Admission Checklist';
        if (this.ehealth.preAdmissionChecklist && this.ehealth.preAdmissionChecklist.length > 0) {
          const lastPdf = this.ehealth.preAdmissionChecklist[this.ehealth.preAdmissionChecklist.length - 1];
          this.file = lastPdf.awsFileName || lastPdf.fileUploadKey;
        } else {
          showAlert = true;
        }
      } else if (property === 'preview') {
        this.message = 'Preview';
        if (this.ehealth.preview.pdfFiles && this.ehealth.preview.pdfFiles.length > 0) {
          const lastPdf = this.ehealth.preview.pdfFiles[this.ehealth.preview.pdfFiles.length - 1];
          // this.file = lastPdf.fileUploadKey;
          this.file = lastPdf.awsFileName || lastPdf.fileKey;
        } else {
          showAlert = true;
        }
      } else if (property === 'letter-of-consent') {
        this.message = 'Letter Of Consent';
        if (this.ehealth.letterOfConsent.pdfFiles && this.ehealth.letterOfConsent.pdfFiles.length > 0) {
          const lastPdf = this.ehealth.letterOfConsent.pdfFiles[this.ehealth.letterOfConsent.pdfFiles.length - 1];
          this.file = lastPdf.awsFileName || lastPdf.fileUploadKey;
        } else {
          showAlert = true;
        }
      } else if (property === 'travel-declaration') {
        this.message = 'Travel Declaration';
        if (this.ehealth.travelDeclaration.pdfFiles && this.ehealth.travelDeclaration.pdfFiles.length > 0) {
          const lastPdf = this.ehealth.travelDeclaration.pdfFiles[this.ehealth.travelDeclaration.pdfFiles.length - 1];
          this.file = lastPdf.awsFileName || lastPdf.fileKey;
        } else {
          showAlert = true;
        }
      }
      if (showAlert) {
        event.target.checked = false;
        if (property === 'medical-condition') {
          // tslint:disable-next-line: max-line-length
          this.dataService.presentAlert('Cannot share ' + this.message + ' because it is not saved. Please save it first and then try again!');
        } else {
          // tslint:disable-next-line: max-line-length
          this.dataService.presentAlert('Cannot share ' + this.message + ' because it is not signed. Please sign it first and then try again!');
        }
      } else {
        this.prevSelectedProperty = property;
        this.selectedForm = property;
      }
    } else {
      this.file = '';
    }
  }
