  public generatePdf(mode) {
    this.message = this.template;
    this.subject = this.template;
    this.link = null;
    this.file = '';
    this.fileName = this.clientDetails.name.replace(/ /g, '_') + '_' + this.template.replace(/ /g, '_') + '.pdf';
    let valuesPresent = true;
    if (this.template === 'Policy Activated') {
      valuesPresent = _.size(this.ehealth.activePolicies) > 0 ? true : false;
    }
    if (valuesPresent) {
      const element = document.getElementById('export-info-pdf-wrap');
      const opt = {
        margin: [30, 10],
        filename: this.fileName,
        html2canvas: {
          useCORS: true,
          // backgroundColor: null,
          scale: 1,
        },
        image: { type: 'jpg', quality: 0.95 },
        jsPDF: { unit: 'mm', format: 'a4', orientation: 'portrait' },
        // pagebreak: { mode: ['css', 'legacy'] }
      };
      const that = this;
      html2pdf()
        .set(opt)
        .from(element)
        .toPdf()
        .get('pdf')
        .then((pdf) => {
          const totalPages = pdf.internal.getNumberOfPages();
          // ? previous watermark img; PREMIUMCARE SG (without space)
          // tslint:disable-next-line: max-line-length
          // const watermarkBase64 = 'data:image/png;base64,';
          // ? new watermark img; PREMIUM CARE SG (with space)
          // tslint:disable-next-line: max-line-length
          const watermarkBase64 = 'data:image/png;base64,'
            + ''
            + ''
            + '';
          for (let i = 0; i < totalPages; i++) {
            pdf.setPage(i);
            const width = pdf.internal.pageSize.getWidth();
            const height = pdf.internal.pageSize.getHeight();
            // pdf.addImage(that.watermarkImg, 'PNG', 0, 0, width, height);
            pdf.addImage(watermarkBase64, 'PNG', 0, 0);
          }
        })
        .output('datauristring').then((resp) => {
          this.file = resp;
          if (mode === 'download') {
            this.downloadFile('information');
          } else {
            this.shareSocialMedia('information');
          }
        });
    } else {
      this.dataService.presentAlert('Cannot share since selected template has no data!');
    }
  }
