  public shareSocialMedia(type) {
    if (this.file && this.file !== '') {
      this.dataService.present().then((loader) => {
        loader.present();
        this.subject = this.message;
        this.link = null;
        // ! remove comments for showing aws file
        if (type === 'forms' && this.message !== 'Medical Condition') {
          if (!this.file.includes(environment.aws.bucketAccessRootPath)) {
            this.file = environment.aws.bucketAccessRootPath + this.file;
          }
        } else {
          if (this.file.includes('filename=generated.pdf;')) {
            this.file = this.file.replace('filename=generated.pdf;', 'filename=' + this.fileName + ';');
          }
          if (this.file.includes('filename=attachment.pdf;')) {
            this.file = this.file.replace('filename=attachment.pdf;', 'filename=' + this.fileName + ';');
          }
        }
        if (!this.internetCheckFlag) {
          this.socialSharing.share(this.message, this.subject, this.file, this.link)
            .then((resp) => {
              this.dataService.dismiss();
            })
            .catch((err) => {
              this.dataService.dismiss();
            });
        } else {
          this.dataService.dismiss();
          this.dataService.presentAlert('Please check your internet connection!');
        }
      });
    } else {
      this.dataService.presentAlert('Select a form to share');
    }
  }
  public openInsuranceDocsModal() {
    if (this.ehealth.insuranceDocs && this.ehealth.insuranceDocs.length > 0) {
      this.modalCtrl.create({
        component: ExportInsuranceDocsModalPage,
        cssClass: 'insurance-docs-modal',
        componentProps: { allFiles: this.ehealth.insuranceDocs, clientDetails: this.clientDetails },
      }).then((modal) => {
        modal.present();
      });
    } else {
      this.dataService.presentAlert('No insurance documents uploaded!');
    }
  }
